import time


class Node:
    def __init__(self):
        self.wordlist = {}
        self.count = 0
        self.index = 0
        self.left = 0
        self.pre = 0
        self.value = 0

    def clear(self):
        self.wordlist.clear()

    def _insert(self, word_list, index, pre, this_index):
        self.count += 1
        self.index = index
        self.left = len(word_list) - this_index
        self.pre = pre
        self.value = word_list
        if this_index >= len(word_list):
            return
        i = word_list[this_index]
        if i not in self.wordlist:
            self.wordlist[i] = Node()
        self.wordlist[i]._insert(word_list, index, pre+1, this_index+1)

    def insert(self, word, index):
        new_word = word[-1:] + word[:-1]
        return self._insert(new_word, index, 0, 0)

    def _get_ans(self, s, ans, this_ans=None):
        if this_ans is None:
            this_ans = []
        left = str(self.left)
        if self.count < 1:
            return
        if self.count == 1 \
                and self.pre >= 2 \
                and self.pre + self.left > 1 + len(left) + len(this_ans):
            ans.append((''.join(this_ans[1:]) + s + left + this_ans[0], self.index))
            return
        found = False
        this_ans.append(s)
        for key in self.wordlist.keys():
            found = True
            self.wordlist[key]._get_ans(key, ans, this_ans)
        del this_ans[-1]
        if not found:
            ans.append((self.value[1:] + self.value[0], self.index))
        return

    def get_ans(self):
        ans = []
        for node in self.wordlist.keys():
            self.wordlist[node]._get_ans(node, ans)
        return ans



class SolutionTLE(object):
    def wordsAbbreviation(self, dict):
        """
        :type dict: List[str]
        :rtype: List[str]
        """
        root = Node()
        new_dict = [(word, len(word), i) for i, word in enumerate(dict)]
        new_dict.sort(key=lambda x: x[1])
        ans = []
        prelength = 0
        for word in new_dict:
            word, length, index = word
            if length != prelength:
                ans.extend(root.get_ans())
                root.clear()
            prelength = length
            root.insert(word, index)
        ans.extend(root.get_ans())
        ans.sort(key=lambda x: x[1])
        return [x[0] for x in ans]


class SolutionAC(object):
    def wordsAbbreviation(self, lst):
        """
        :type dict: List[str]
        :rtype: List[str]
        """
        abbr = {}
        for i in range(len(lst)):
            w = lst[i]
            v = abbr.setdefault((w[0], w[-1], len(w) - 2), [])
            v.append(i)
        removes = []
        for k, v in abbr.items():
            if len(v) == 1:
                lst[v[0]] = self.formatout(k, lst[v[0]])
                removes.append(k)
        for r in removes:
            del abbr[r]
        while len(abbr) > 0:
            abbr2 = {}
            removes = []
            for k, v in abbr.items():
                for i in v:
                    kk = (k[0] + lst[i][len(k[0])], k[1], k[2] - 1)
                    vv = abbr2.setdefault(kk, [])
                    vv.append(i)
                removes.append(k)
            for k, v in abbr2.items():
                abbr[k] = v
            for k in removes:
                del abbr[k]

            removes = []
            for k, v in abbr.items():
                if len(v) == 1:
                    lst[v[0]] = self.formatout(k, lst[v[0]])
                    removes.append(k)
            for k in removes:
                del abbr[k]
        return lst

    def formatout(self, k, w):
        s = '%s%d%s' % (k[0], k[2], k[1])
        if k[2] > 1:
            return s if len(s) < len(w) else w
        else:
            return w

